import React from 'react'

export default function ScoreDisplay(props) {
    return (
        <div className = 'score-display'>
            {props.appState.map(end => {
                <EndItem arrowValues = {end.endValues} endScore = {end.endScore} totalScore = {end.totalScore} />
            })}
        </div>
    )
}

